// Printing.js
// Detailed page for operational and offset printing services.

import React from 'react';
import { Link } from 'react-router-dom';

const Printing = () => {
  return (
    <div className="service-page">
      <h1>Оперативная и офсетная печать</h1>
      <img
        src={process.env.PUBLIC_URL + '/img/printing.png'}
        alt="Оперативная и офсетная печать"
        className="service-page__image"
      />
      <p>
        Изготавливаем визитки, листовки, брошюры, сертификаты и другую
        полиграфическую продукцию. Оперативная цифровая печать подходит для
        небольших тиражей, а офсетная — для крупных заказов. Поможем выбрать
        подходящий формат и материал.
      </p>
      <p>
        <strong>Стоимость:</strong> рассчитывается индивидуально в зависимости от
        тиража и материалов.
      </p>
      <p><strong>Срок исполнения:</strong> от 1 дня.</p>
      <Link to="/services" className="btn btn-primary">
        Вернуться к услугам
      </Link>
    </div>
  );
};

export default Printing;
